description:
Reviewers and game players all over the world agree!

&quot;KKnD is one of the best strategy games ever played&quot; 

and

&quot;KKnD has some of the best computer AIs&quot;

But we're not satisfied. We've taken KKnD and rebuilt it for Windows '95, also adding new game modes and new missions. KKnD Xtreme takes the original game and enhances it with a huge list of improvements. KKnD Xtreme is a stand-alone product that includes all 30 KKnD missions, plus 20 new missions that will tax even the best KKnD players.

In addition to the extra missions we've listened to our customers and included many of the features most asked for, including a skirmish mode and a host of interface and gameplay movements.
